import React, { useEffect, useState } from 'react';
import PostList from '../components/PostList';
import HandlePost from '../components/HandlePost';
import NavigationBar from '../components/NavigationBar';
import Header from '../components/Header';
import FriendCard from '../components/FriendCard';
import SearchBar from '../components/SearchBar';
import Stories from '../components/Stories';
import ListFriends from '../components/ListFriends';

export default function HomePage() {
    useEffect(() => {
        import('../styles/homepage.css')
        
    }, [])

    return (
        <div id="app">
            <NavigationBar />
            {/* WRAPPER */}
            <div className='flex-1'>
                {/* HEADER */}
                <Header title="Homepage" isSearchBar={true} />
                {/* WRAP CONTENT */}
                <div id='wrap-content-homepage' className="row">
                    <div id="content">
                        {/* STORIES */}
                        <Stories />
                        
                        {/* HANDLE POST */}
                        <HandlePost />
                        <div className="post">
            <div className="row justify-between">
                {/* LEFT */}
                <div className="row align-items">
                    <img
                        className="avatar"
                        src={`${server}/uploads/${sender.avatar}`}
                        alt=""
                    />

                    <div className="ml-10">
                        <p className="user">{sender.firstName + " " + sender.lastName}</p>
                        <p className="time">{creationTime}</p>
                    </div>
                </div>
                {/* RIGHT */}
                <ul className="list-icon row">
                    <li>
                        <i className="fa-solid fa-bookmark" />
                    </li>
                    <li className='more' onClick={activeTooltips}>
                        <i className="fa-solid fa-ellipsis-vertical" />

                        {/* MORE OPTIONS */}
                        <ul className={(isActiveTooltip) ? 'tooltips tooltips-active' : 'tooltips'}>
                            <li className={
                                (sender._id !== user._id) ? 'disable' : ''
                            }
                                onClick={handleDeletePost}><span className="material-symbols-outlined">delete</span>Delete This Post</li>

                            <li><span className="material-symbols-outlined">delete</span>Add Bookmark</li>
                        </ul>
                    </li>
                </ul>
            </div>
            <p className="text">
                Layout 4 image
            </p>
            <div className={`list-image ${existImage ? 'box-active' : 'box-disable'}`}>
                <div className='layout-image-4'></div>
            </div>
            {/* Emoji */}
            <div className="emoji">
                <div>
                    <i className="fa-regular fa-heart" />
                    <span>Heart</span>
                </div>
                <div>
                    <i className="fa-regular fa-comment" />
                    <span>Comment</span>
                </div>
                <div>
                    <i className="fa-solid fa-share" />
                    <span>Share</span>
                </div>
            </div>
        </div>
                       
                        {/* NƠI ĐẶT POST DO NGƯỜI DÙNG ĐĂNG */}
                        <PostList />       
                        {/* --------------------------------------- */}
                    </div>
                    {/* RIGHT SIDEBAR */}
                   <ListFriends />
                </div>
            </div>
        </div>
    );
}
